INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (0.0, 1, 3.414, 1, 1, "2025/01/31 12:00:00", 2, "カリン", 190801, -416.5, "2030/01/01 14:59:59", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 62, 1000001);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (0.0, 2, 3.099, 1, 1, "2025/01/31 12:00:00", 2, "カリン", 190801, -416.5, "2030/01/01 14:59:59", "ミッションをクリアして、\n報酬をゲットしましょう！", 62, 1000002);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (0.0, 3, 2.801, 1, 1, "2025/01/31 12:00:00", 2, "カリン", 190801, -416.5, "2030/01/01 14:59:59", "受け取ることができる\n報酬があるようです\n確認してみてください", 63, 1000003);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (0.0, 4, 0.0, 1, 2, "2025/01/31 12:00:00", 2, "カリン", 190801, -416.5, "2030/01/01 14:59:59", "報酬がもらえますよ！\nチェックしてみてください", 63, 1000004);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (0.0, 5, 2.12, 1, 2, "2025/01/31 12:00:00", 1, "カリン", 190801, -363.0, "2030/01/01 14:59:59", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 64, 1000005);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (0.0, 6, 1.68, 1, 1, "2025/01/31 12:00:00", 2, "カリン", 190801, -363.0, "2030/01/01 14:59:59", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 64, 1000006);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (0.0, 7, 2.33, 1, 2, "2025/01/31 12:00:00", 1, "カリン", 190801, -363.0, "2030/01/01 14:59:59", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 64, 1000007);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (-6.0, 101, 5.18, 10201, 3, "2025/01/31 12:00:00", 7, "ラビリスタ", 133701, -285.0, "2030/01/01 14:59:59", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 61, 1020101);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (-2.0, 201, 8.77, 10201, 1, "2025/01/31 12:00:00", 2, "クリスティーナ", 133901, -285.0, "2030/01/01 14:59:59", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 61, 1020102);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (0.0, 301, 15.5, 10201, 6, "2025/01/31 12:00:00", 1, "ネネカ", 133801, -285.0, "2030/01/01 14:59:59", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 61, 1020103);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (0.0, 101, 9.061, 10202, 2, "2025/02/28 12:00:00", 5, "ランファ", 134301, -285.0, "2030/01/01 14:59:59", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 61, 1020201);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (0.0, 201, 7.699, 10202, 1, "2025/02/28 12:00:00", 2, "チカ", 134401, -285.0, "2030/01/01 14:59:59", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 61, 1020202);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (0.0, 101, 8.595, 10203, 1, "2025/03/31 12:00:00", 2, "アオイ", 134601, -285.0, "2030/01/01 14:59:59", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 61, 1020301);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (0.0, 201, 7.758, 10203, 1, "2025/03/31 12:00:00", 2, "クローチェ", 134501, -285.0, "2030/01/01 14:59:59", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 61, 1020302);
